import React from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';

// Import Layout & Pages
import Navbar from './components/Navbar';
import ProtectedRoute from './components/ProtectedRoute'; // Import the helper
import LoginPage from './pages/LoginPage';
import SignupPage from './pages/SignupPage';
import RecipeListPage from './pages/RecipeListPage';
import RecipeDetailPage from './pages/RecipeDetailPage';
import RecipeForm from './pages/RecipeForm';
import MealPlanListPage from './pages/MealPlanListPage';
import MealPlanDetailPage from './pages/MealPlanDetailPage';
import ProfilePage from './pages/ProfilePage';

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      {/* This pt-16 (padding-top: 4rem) prevents content from being hidden by the fixed navbar */}
      <div style={{ paddingTop: '4rem', minHeight: '100vh', backgroundColor: '#f9fafb' }}> 
        <Routes>
          {/* Public Routes */}
          <Route path="/login" element={<LoginPage />} />
          <Route path="/signup" element={<SignupPage />} />

          {/* Protected Routes (Main App) */}
          <Route 
            path="/recipes" 
            element={<ProtectedRoute><RecipeListPage /></ProtectedRoute>} 
          />
          <Route 
            path="/recipes/:id" 
            element={<ProtectedRoute><RecipeDetailPage /></ProtectedRoute>} 
          />
          <Route 
            path="/recipes/new" 
            element={<ProtectedRoute><RecipeForm /></ProtectedRoute>} 
          />
          <Route 
            path="/recipes/edit/:id" 
            element={<ProtectedRoute><RecipeForm /></ProtectedRoute>} 
          />
          <Route 
            path="/mealplans" 
            element={<ProtectedRoute><MealPlanListPage /></ProtectedRoute>} 
          />
           <Route 
            path="/mealplans/:id" 
            element={<ProtectedRoute><MealPlanDetailPage /></ProtectedRoute>} 
          />
           <Route 
            path="/profile" 
            element={<ProtectedRoute><ProfilePage /></ProtectedRoute>} 
          />
          
          {/* Default Route: Redirect to recipes if logged in, or login if not */}
          <Route 
            path="*" 
            element={<ProtectedRoute><Navigate to="/recipes" replace /></ProtectedRoute>} 
          />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
